import React from 'react';

const Intro = () => (
    <div className="intro">
        <div className="text">
            <h4>We bring the funk and bring it hard!</h4>
            <p>We are the premiere dance pop/funk band in the Treasure Valley.  We inspire your patrons to move and they will thank you for it!  We play a range of funk and dance rock to old school grooves.</p>
            <p>We bring together a colloboration of musical expertise, experience and fiery energy to our playing and we truly love what we do.</p>
        </div>
    </div>
)

export default Intro;
